import React from 'react';
import './App.css';
import {BrowserRouter,Route,Routes} from "react-router-dom"


import Landing from '../src/components/LandingPage/Landing_Page';
import PostView from './components/PostView/PostView';
import Header from './components/PostView/header'
import Form from './components/PostView/form';
import Error from './components/PostView/Error';





function App() {
  return (
    <div className="wrapper">
  <BrowserRouter>
  <Routes>
   <Route path="/" element={ <Landing/>}/>
   <Route path="/post"  element={<Header/>}/>
   <Route path="/enter" element={ <PostView />}/>
  <Route path="/form" element={<Form/>}/>

  <Route path='*' element={<Error/>}/>
  </Routes>

   </BrowserRouter>


    </div>
  );
}


export default App;
